import Landing from "./pages/Landing"
import { BrowserRouter,Route,Routes,Link } from "react-router-dom";
function App() {
  return (

    <BrowserRouter>
      <Routes>

      <Route path="/" element={<div>Dashboard</div>}/>
        <Landing/>
      </Routes>
    </BrowserRouter>

  );
}

export default App;
